import React from 'react';
import './App.css';
import Login from './paginas/Login';
import Dashboard from './paginas/Dashboard';
import Home from './paginas/Home';
import Header from "./componentes/Header";
import { BrowserRouter, Switch, Route, NavLink } from 'react-router-dom';
import PrivateRoute from "./componentes/PrivateRoute";
import PublicRoute from "./componentes/PublicRoute";



class App extends React.Component{
    render () {
        return (
            <div>

                <Header className="App-header" />

                <BrowserRouter>
                    <div>
                        <div className="header">
                            <NavLink exact activeClassName="active" to="/accion_social/home">Home</NavLink>
                            <NavLink activeClassName="active" to="/accion_social/login">Login</NavLink>
                            {/*<NavLink activeClassName="active" to="/accion_social/dashboard">Dashboard</NavLink>*/}
                        </div>
                        <div className="content">
                            <Switch>
                                <PrivateRoute exact path="/accion_social/" component={Home} />
                                <PublicRoute path="/accion_social/login" component={Login} />
                                {/*<Route path="/accion_social/dashboard" component={Dashboard} />*/}
                            </Switch>
                        </div>
                    </div>
                </BrowserRouter>

            </div>
        );
    }
}

export default App;
